    /**
     * This validates a coded element.
     *
     * @param oCE The coded to be validated.
     * @param sCode The value the code should be.
     * @param sDisplayName The value the display name should be.
     * @param sCodeSystem The value the code system should be.
     * @param sCodeSystemName The value the code system name should be.
     */
    private void assertValidCE(CeType oCE, String sCode, String sDisplayName, String sCodeSystem, String sCodeSystemName)
    {
        assertNotNull(oCE);

        if (sCode != null)
        {
            assertEquals("CeType.Code", sCode, oCE.getCode() );
        }
        else
        {
            assertNull("CeType.Code should have been null.", oCE.getCode());
        }

        if (sDisplayName != null)
        {
            assertEquals("CeType.DisplayName", sDisplayName, oCE.getDisplayName() );
        }
        else
        {
            assertNull("CeType.DisplayName should have been null.", oCE.getDisplayName());
        }

        if (sCodeSystem != null)
        {
            assertEquals("CeType.CodeSystem", sCodeSystem, oCE.getCodeSystem() );
        }
        else
        {
            assertNull("CeType.CodeSystem should have been null.", oCE.getCodeSystem());
        }

        if (sCodeSystemName != null)
        {
            assertEquals("CeType.CodeSystemName", sCodeSystemName, oCE.getCodeSystemName() );
        }
        else
        {
            assertNull("CeType.CodeSystemName should have been null.", oCE.getCodeSystemName());
        }

    }

